import { put, takeEvery } from "redux-saga/effects";



export function* doRegistration(): IterableIterator<any>{
    yield takeEvery('SUCCSSES', function*(action: any){
        const {
            data: { email, password, fir }
          } = action;
    
          console.log(email + password);
           
    })
    return "2"
}
